/* =============================================================
   INTERACTIVE UI THEME FOR THINGSBOARD
   Smooth animations â¢ Neumorphism â¢ Modern â¢ Safe
   ============================================================= */

/* ----- GLOBAL WIDGET CARD STYLE ----- */
.tb-widget, .widget, .tb-widget-container {
  background: #ffffff !important;
  border-radius: 18px !important;
  padding: 14px !important;
  border: 1px solid rgba(0,0,0,0.06) !important;
  box-shadow: 0 6px 18px rgba(0,0,0,0.08) !important;
  transition: transform 0.18s ease, box-shadow 0.18s ease !important;
  overflow: hidden;
}

/* Hover floating effect */
.tb-widget:hover {
  transform: translateY(-6px) !important;
  box-shadow: 0 14px 30px rgba(0,0,0,0.14) !important;
}

/* ----- BIG NUMBER WIDGETS (Temp, Humidity, Lux, etc.) ----- */
.tb-widget .tb-widget-value-number {
  transition: transform 0.25s ease, color 0.25s ease;
}

/* Pulse animation when value updates */
@keyframes sensorPulse {
  0% { transform: scale(1); }
  45% { transform: scale(1.06); }
  100% { transform: scale(1); }
}

.tb-value-update {
  animation: sensorPulse 0.5s ease;
}

/* ----- CHART WIDGET FIX + INTERACTIVITY ----- */
.tb-widget .chart-wrapper, 
.tb-widget .chart-container {
  border-radius: 14px !important;
  background: rgba(240, 244, 255, 0.6) !important;
  backdrop-filter: blur(6px) !important;
}

/* Chart border glow */
.tb-widget canvas {
  transition: filter 0.3s ease;
}

.tb-widget:hover canvas {
  filter: brightness(1.05);
}

/* ----- LIGHT GAUGE (lux) ----- */
.tb-widget .radial-gauge,
.tb-widget .tb-gauge {
  filter: drop-shadow(0 4px 10px rgba(0,0,0,0.12));
  transition: transform 0.25s ease;
}

.tb-widget:hover .radial-gauge {
  transform: scale(1.03);
}

/* ----- SLIDER WIDGET ----- */
.tb-widget .mat-slider {
  filter: drop-shadow(0 4px 8px rgba(0,0,0,0.1));
  transition: filter 0.2s ease;
}

.tb-widget:hover .mat-slider {
  filter: drop-shadow(0 6px 14px rgba(0,0,0,0.2));
}

/* ----- FAN CONTROL (RPC BUTTON) ----- */
.tb-widget .mat-button, 
.tb-widget button {
  background: linear-gradient(180deg, #f5f8ff, #e9efff) !important;
  border-radius: 50px !important;
  padding: 6px 20px !important;
  border: 1px solid rgba(0,0,0,0.08) !important;
  transition: background 0.25s ease, transform 0.15s ease;
}

.tb-widget .mat-button:hover {
  background: linear-gradient(180deg, #e6eeff, #d8e5ff) !important;
  transform: scale(1.04);
}

/* Button click ripple */
.tb-widget .mat-button:active {
  transform: scale(0.96);
}

/* ----- TITLE STYLE ----- */
.tb-widget .tb-widget-title {
  font-size: 16px !important;
  font-weight: 700 !important;
  color: #1e2a42 !important;
  margin-bottom: 8px !important;
}

/* ----- ALARM TABLE ENHANCED UI ----- */
.tb-widget .mat-row {
  border-radius: 10px !important;
  background: #ffffff !important;
  transition: background 0.2s ease, transform 0.2s ease;
}

.tb-widget .mat-row:hover {
  background: #f5f9ff !important;
  transform: translateX(4px);
}

/* Critical severity flashing badge */
@keyframes criticalBlink {
  0% { color: #ff5252; }
  50% { color: #ff8a80; }
  100% { color: #ff5252; }
}

.tb-widget .severity-critical {
  animation: criticalBlink 1s infinite ease-in-out;
  font-weight: 700 !important;
}

/* Pagination UI */
.tb-widget .mat-paginator {
  background: transparent !important;
  color: #334866 !important;
}
